import React from "react";
import "../App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { ListItemCardData } from "./ListItemCardData";
import { ReactComponent as GiftIcon } from "../assets/icons/gift.svg";
import { ReactComponent as NextIcon } from "../assets/icons/next.svg";

import {
  Container,
  Row,
  Col,
  Card,
  ListGroup,
  ListGroupItem,
} from "react-bootstrap";

function CardItem(props) {
  return (
    <>
      <style type="text/css">
        {`
    .card-header  {
        color: #272931;
         background-color: #ffffff;
         height: 60px;
         border: 0px;
         justify-content: center;
         align-items: center;
      }

      .card-header:first-child {
        border-radius:  20px;
      }

    `}
      </style>
   
            <Card.Header className="bg">
              {props.iconHeader}
              <span>{props.titleHeader}</span>
              <span>{props.status}</span>
            </Card.Header>
            <Card.Img variant="top" src={props.image} />
            <Card.Body>
              <Card.Title>{props.title}</Card.Title>
              <Card.Text>
                <GiftIcon />
                {props.giftTitle}
              </Card.Text>
            </Card.Body>
            {ListItemCardData.map((val, key) => {
              return (
                <ListGroup key={key} className="list-group-flush">
                  <ListGroupItem>
                    {val.item1}
                    <span>{props.item1}</span>
                    <NextIcon />
                  </ListGroupItem>
                  <ListGroupItem>
                    {val.item2}
                    <span>{props.item2}</span>
                    <NextIcon />
                  </ListGroupItem>
                  <ListGroupItem>
                    {val.item3}
                    <span>{props.item3}</span>
                  </ListGroupItem>
                  <ListGroupItem>
                    {val.item4}
                    <span>{props.item4}</span>
                    </ListGroupItem>
                </ListGroup>
              );
            })}
      
    </> 
  );
}

export default CardItem;
